  padding: 20px; 
  margin: 40px 0;
  width: 95%;
  background: white;
  border-radius: 40px;
  margin: auto;
  overflow: visible;

  min-width: 380spx;
  max-width: 650px;

  height: 100%;
`;
const Header = styled.div `
  font-weight: 800;
  font-size: 4vw;
`;
const Flavor = styled.div `
  font-size: 2vw;
  font-style: italic;
  color: gray;
`;
const Text = styled.div `
  font-size: 4vw;
`;

function Body() {
  return (
    <Core>
      <Section>
        <Header>Who am I?</Header>
        <Flavor>Good question... Do we ever really know?</Flavor>
        <Text>
          I am a Senior at Oregon State University studying 
          Computer science. I specialize in Web and Cloud 
          Development but in my free time time I create websites 
          and games.
        </Text>
      </Section>
